description:
"'I am much afraid that the universities will prove to be the great gates of hell, unless they diligently labor in explaining the Holy Scriptures, and engraving them in the hearts of youth. I advise no one to place his child where the Scriptures do not reign paramount. Every institution in which men are not unceasingly occupied with the word of God must become corrupt."-- Ibid., b. 6, ch. 3.  {GC 140.5} 

Many think that in order to obtain an education it is necessary to study the productions of writers who teach infidelity, because their works contain some bright gems of thought. But who was the originator of these gems of thought? It was God, and God alone. He is the source of all light. Why should we wade through the mass of error contained in the works of pagans and infidels, for the sake of a few intellectual truths, when all truth is at our command?  {8T 306.1}   

15c. "The mastermind in the confederacy of evil is ever working to keep out of sight the words of God, and to bring into view the opinions of men. He means that we shall not hear the voice of God, saying, "This is the way, walk ye in it." Isaiah 30:21. Through perverted educational processes he is doing his utmost to obscure heaven's light.  {MH 439.1}  

